Queries about the instances
• Give me all the towns and its population (if
they have the property population defined)
PREFIX pr: <http://GP-onto.fi.upm.es/Practica2#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?x ?y  WHERE { $place a pr:Localidad;
rdfs:label ?x.
OPTIONAL {$place pr:NumeroHabitantes ?y.}
}
